import { Component } from "react";
class Lock extends Component{
  constructor(props){
    super(props);
    this.state={
      value:""
    }
  }
  click=(e)=>{
    this.setState({
      value:e.target.value
    })
  }
  render(){
    return(
        <div style={{textAlign:"center",padding:"0px",backgroundColor:"pink"}}>
          <input type="text"/><br/>
           <button onClick={this.click}>AC</button>
           <button onClick={this.click}>DEL</button>
           <button onClick={this.click}>+</button><br/>
           <button onClick={this.click}>1</button>
           <button onClick={this.click}>2</button>
           <button onClick={this.click}>3</button>
           <button onClick={this.click}>*</button><br/>
           <button onClick={this.click}>4</button>
           <button onClick={this.click}>5</button>
           <button onClick={this.click}>6</button>
           <button onClick={this.click}>+</button><br/>
           <button onClick={this.click}>7</button>
           <button onClick={this.click}>8</button>
           <button onClick={this.click}>9</button>
           <button onClick={this.click}>-</button><br/>
           <button onClick={this.click}>.</button>
           <button onClick={this.click}>0</button>
           <button onClick={this.click}>=</button>
          </div>
    )
  }
}
export default Lock;
